import dbConnect from "../../../utils/dbConnect";

// dbConnect();

export default async (req, res) => {
    try {
        res.status(200).json({
            success: true,
            message: 'test'
        });
    }catch (e) {
        res.status(400).json({
            success: false
        })
    }
}
